//this intro doesnt really need to be changed
import thatme from '../assets/thatme.png'

const Aboutme = (props) => {
    return (
        <div className="container-fluid my-container">
            <div className="row my-row" style={{justifyContent: 'center',}}>
            <div className="row bound my-col">

                {/* Title Col */}
                <div className="col-m my-container" style={{width:'100%'}}>
                    <h1>What I'm up to</h1>
                </div>

                {/* Content Col */}
                <div className="col-m my-container">
                    <p>{props.firstChunk}<br /><br />{props.secondChunk}</p>
                    <img src={thatme} style={{width:'80%'}}/>
                </div>

            </div>
            </div>
        </div>
    )
}

export default Aboutme
